import { Router } from './router';

export const router = new Router();
router.register('ROUTE:HOME', { path: '/' });
router.register('ROUTE:FRAMEWORK:ANGULAR', { path: '/framework/angular' });
router.register('ROUTE:FRAMEWORK:JAVASCRIPT', { path: '/framework/javascript' });
router.register('ROUTE:FRAMEWORK:OVERVIEW', { path: '/framework/overview' });
router.register('ROUTE:FRAMEWORK:REACT', { path: '/framework/react' });
router.register('ROUTE:FRAMEWORK:VUE', { path: '/framework/vue' });
router.register('ROUTE:COMPONENT:DETAILS', { path: '/component/[key]' });
